const Cardlist =({robots})=>{
  return (
      <div className="tc">
      {
     robots.map((user,i) => {
      return (
      <Card
       key={i}
       id={robo[i].id} 
       name={robo[i].name}
       email={robo[i].email} 
       />)
      })
      }
      </div>  
      // Tag elements unifies under single parent or fragment,else these func enclose it in destructure. 
      // User is used indirectly.
  );
}

export default Cardlist;
